import React from 'react';
import {AiFillLike} from 'react-icons/ai';
import Tilt from 'react-parallax-tilt';
function Add() {
  return (
    <div>
        <h3 class="mb-6">Add Offers</h3>
        <div className=' box col-lg-3 col-sm-6 col-md-3 m-5'>
          <div class="card h-100 text-center p-4" key="{id}">
            <Tilt scale={1.1}>
            <img  src="img.png" class="card-img-top" alt="{product.title}" height="200px" /></Tilt>
            <div class="card-body">
                <h5 class="card-title mb-0">Product Name</h5>
                <p class="card-text">INR 1000</p>
                <i className="like"><AiFillLike/>5</i> 
                <a  href="#" class="btn btn-primary">View Details</a>
            </div>
           </div>
        </div>
    </div>
  )
}

export default Add;
